import React from 'react';
import { Layout } from 'antd';

const Header = () => {
  return (
      <Layout.Header>
        <p style={{color: 'white'}}>Timeline de compras</p>
        <link href="../icons/calendar.svg" rel="icon"  type="image/x-icon" />
      </Layout.Header>
  );
};

export default Header;
